response.about:
Вы смеётесь надо мной, потому что я отличаюсь от вас, а я смеюсь над вами, потому что вы не отличаетесь друг от друга! Мне плевать на всю ту критику, которая обрушивается в мой адрес. Мне параллельно на то, что где-то появится плохой отзыв обо мне. Мне всё равно, если кто-то скажет, что я сука и стерва, я просто не умею общаться с вами-мудаками! А Вы хотели разбить мою мечту? Обломитесь. Она у меня небьющаяся и противоударная ..=))))


Я не голубоглазая – глаза у меня серые, и находятся они выше, чем Вы смотрите;
Я не красива – я чертовски мила;
Я не стерва – я просто нетолерантна;
Я не знаю себе цену – я ни разу ее не называла;
Я не принцесса – но для некоторых просто подарок;
Я не разгильдяйка – я просто люблю поспать;
Я не неряха – мне просто мало места в шкафах;
Я не вру – я сочиняю;
Со мной не пропадешь – но горя хапнешь;
Я Вам не хамлю – я просто использую длинные слова;
Я Вас не перебиваю – просто у Вас регламент;
Я не серьезная – мне скучно;
Я не туплю – я не в настроении;
Я над Вами не издеваюсь – я Вас изучаю;
Я не использую дрянные аргументы – просто в моей коллекции дураков Вы не попали в десятку лучших;
Я Вас не игнорирую – просто Вы малозначимы;
Я всех не ненавижу – всех я люблю, но некоторых меньше;

Я такая, как есть, я не буду другой,
Я такая, как есть, я останусь такой.
Я наивна бываю, бываю-вредна,
Но, такая, как есть, я на свете ОДНА.
Я такая как есть, я умею любить.
Кто увидит меня, тот не сможет забыть.
Я умею ласкать, но умею и бить.
Я умею спасать и умею губить.
Я такая, как есть, я похожа на страсть.
Строя жизнь, я себя успеваю ломать.
Я не много грущу, и немного смеюсь.
Я бесстрашна бываю, но я и боюсь.
Я такая, как есть, я люблю помогать.
Но бывает, что я не могу не кричать.
Я бываю вольна, я бываю одна.
Пылкой быть я могу, а потом-холодна.
Я такая, как есть, я не стану иной.
Я немного поплачу у Вас за спиной,
Вытру слёзы и мило в ответ улыбнусь.
И такой, как я есть, к вам опять повернусь..
